int exiEXIforJSEncodeAttribute(bitstream_t* stream, exi_state_t* state, size_t namespaceUriID, size_t localNameID,
		exi_value_t* val) {
	int16_t moveOnID = 0;
	int16_t currentID = state->grammarStack[state->stackIndex];
	int successAT1st;
	errn = EXI_ERROR_UNEXPECTED_ATTRIBUTE;

	switch (currentID) {

	}

	/* no expected attribute */
	if (currentID < 0) {
		/* runtime element */
		errn = _encode2ndLevelAttribute(stream, state, namespaceUriID, localNameID, val);
	} else {


		if(moveOnID == 0) {
			/* no action yet */

			/* try AT(*) on first level */
			errn = _encodeAttributeGeneric(stream, state, &successAT1st);
			if(errn == 0) {
				if(successAT1st) {
					/* Successful */
					if(errn == 0) {
						/* encode qname as hits */
						_exiEncodeQNameHit(stream, state, namespaceUriID, localNameID);
						if(errn == 0) {
							/* TODO global attribute datatype */
							switch(val->type) {
							case EXI_DATATYPE_STRING:
								errn = encodeStringValue(stream, state->stringTable, namespaceUriID, localNameID, &val->str);
								break;
							case EXI_DATATYPE_INTEGER:
								errn = encodeInteger(stream, &val->integer);
								break;
							case EXI_DATATYPE_UNSIGNED_INTEGER:
								errn = encodeUnsignedInteger(stream, &val->integer);
								break;
							default:
								errn = EXI_UNSUPPORTED_DATATYPE;
							}
						}
					}
				} else {
#if EXI_OPTION_STRICT != 0
					/* no 2nd level events in strict mode for schema-informed grammars */
					errn = EXI_ERROR_UNEXPECTED_ATTRIBUTE;
#else /* EXI_EXIforJSSTRICT != 0 */
					errn = _encode2ndLevelAttribute(stream, state, namespaceUriID, localNameID, val);
#endif /* EXI_EXIforJSSTRICT != 0 */
				}
			}
		} else {
			state->grammarStack[state->stackIndex] = moveOnID;
		}
	}

	return (errn);
}


